script: |
  super -f text -I q12492.spq | sort > q12492.out

inputs:
  - name: q12492.spq
    data: |
      SELECT col1 + + col1 + + 68 AS col0 FROM tab2 (FORMAT parquet) cor0 WHERE NOT col1 NOT BETWEEN - col0 AND + - col0 * - col1 * + 14 + col2;
  - name: tab2

outputs:
  - name: q12492.out
    data: |
      170
      202
      222
